from hospital.views.management_views import *from hospital.views.doctor_views import DoctorViewSetfrom rest_framework import routersfrom django.urls import path, includerouter = routers.DefaultRouter()router.register('experience', ExperienceViewSet)router.register('availability', AvailabilityViewSet)router.register('laboratories', LaboratoriesViewSet)router.register('department', DepartmentViewSet)router.register('service', ServiceViewSet)router.register('doctor', DoctorViewSet)urlpatterns = [    path('', include(router.urls)),]